var title_f1_16_1286="CBD and PD pressures manometry";
var content_f1_16_1286=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F57960%7EGAST%2F54223&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F57960%7EGAST%2F54223&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 536px\">",
"   <div class=\"ttl\">",
"    Comparison of pressures in the pancreatic and common duct segments of the sphincter of Oddi",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 516px; height: 255px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Sphincter of Oddi manometry. Comparison of the sphincter of Oddi (SO) pressures obtained from both the pancreatic segment (PD) and common duct (CBD) segment of the SO during catheter pull-through of the sphincter in the same patient. The pressures are equivalent. (BM refers to \"black marks\" noted on the catheter.)",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Walter J Hogan, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 512px\">",
"   <div class=\"ttl\">",
"    Sphincter of Oddi manometry",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 492px; height: 251px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Sphincter of Oddi (SO) pressure profile obtained by catheter pull-through from the common bile duct (CBD) into the duodenum. The three recording tips (proximal to distal) encompass a 4 mm length. The basal SO pressure and superimposed SO phasic waves are demonstrated in all tips.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Walter J Hogan, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
