"   <div class=\"cntnt\" style=\"width: 432px; height: 311px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Erythematous, scaly plaques are visible on this patient with plaque stage mycosis fungoides.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from www.visualdx.com. Copyright Logical Images, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Mycosis fungoides - plaque stage",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
