var title_f1_16_1293="Food-borne diseases III";
var content_f1_16_1293=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F62562&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F62562&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Guidelines for confirmation of food-borne disease outbreaks-III",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Etiologic agent",
"       </td>",
"       <td class=\"subtitle1\">",
"        Incubation period",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical syndrome",
"       </td>",
"       <td class=\"subtitle1\">",
"        Confirmation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Bacterial (cont.)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"3\">",
"        Nontyphoidal",
"        <em>",
"         Salmonella",
"        </em>",
"       </td>",
"       <td rowspan=\"3\">",
"        6 hrs-10 days, usually 6-48 hours",
"       </td>",
"       <td rowspan=\"3\">",
"        Diarrhea, often with fever and abdominal cramps",
"       </td>",
"       <td>",
"        Isolation of organism of same serotype from clinical specimens from two or more ill persons",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Isolation of organism from epidemiologically implicated food",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"indent1\" rowspan=\"3\">",
"        <em>",
"         Salmonella",
"        </em>",
"        typhi",
"       </td>",
"       <td rowspan=\"3\">",
"        3-60 days, usually 7-14 days",
"       </td>",
"       <td rowspan=\"3\">",
"        Fever, anorexia, malaise, headache, and myalgia; sometimes diarrhea or constipation",
"       </td>",
"       <td>",
"        Isolation of organism from clinical specimens or two or more ill persons",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Isolation of organism from epidemiologically implicated food",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"indent1\" rowspan=\"3\">",
"        <em>",
"         Shigella",
"        </em>",
"       </td>",
"       <td rowspan=\"3\">",
"        12 hrs-6 days, usually 2-4 days",
"       </td>",
"       <td rowspan=\"3\">",
"        Diarrhea (often bloody), frequently accompanied by fever and abdominal cramps",
"       </td>",
"       <td>",
"        Isolation of organism of same serotype from clinical specimens from two or more ill persons",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Isolation of organism from epidemiologically implicated food",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"indent1\" rowspan=\"5\">",
"        <em>",
"         Staphylococcus aureus",
"        </em>",
"       </td>",
"       <td rowspan=\"5\">",
"        30 min-8 hours, usually 2-4 hours",
"       </td>",
"       <td rowspan=\"5\">",
"        Vomiting, diarrhea",
"       </td>",
"       <td>",
"        Isolation of organism of same phage type from stool or vomitus of two or more ill persons",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Detection of enterotoxin in epidemiologically implicated food",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Isolation of &ge;10",
"        <sup>",
"         5",
"        </sup>",
"        organisms/g from epidemiologically implicated food, provided specimen properly handled",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"indent1\" rowspan=\"3\">",
"        Group A streptococcus",
"       </td>",
"       <td rowspan=\"3\">",
"        1-4 days",
"       </td>",
"       <td rowspan=\"3\">",
"        Fever, pharyngitis, scarlet fever, upper respiratory infection",
"       </td>",
"       <td>",
"        Isolation of organism of same M- or T-type from throats of two or more ill persons",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Isolation of organism of same M- or T-type from epidemiologically implicated food",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: file://www.cdc.gov/mmwr//mmwr.html.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
